snippet.description:
Πάρε πράματα για το GTA ONLINE ΕΔΩ : https://www.eldorado.gg/SKILLZ


Στο σημερινό επεισόδιο του GTA RP, ο Hitman περνάει την πιο κρίσιμη στιγμή της ζωής του: το μεγάλο δικαστήριο.
Μετά από δεκάδες αποστολές, ληστείες και συγκρούσεις, έφτασε η ώρα της κρίσης… Θα μου ρίξουν ισόβια;
Δείτε όλη την ακροαματική διαδικασία, τις κατηγορίες, τις αντιδράσεις και το ΤΕΛΙΚΟ αποτέλεσμα που θα αλλάξει την ιστορία του Emerald City.

🔥 Μην ξεχάσεις να κάνεις LIKE & SUBSCRIBE, έρχεται τεράστια συνέχεια στο storyline!
💬 Γράψε στα σχόλια: Πόσο πιστεύεις ότι έπρεπε να φάει ο Hitman;

